Ass mentioned in #1720 I would like to have a virtall tlb implementation. I have implemented a draft version to have some code to discuss:

```
static int perms_to_prot(int perms)
{
    int ret = 0;
    if (perms & UC_PROT_READ) {
        ret |= PAGE_READ;
    }   
    if (perms & UC_PROT_WRITE) {
        ret |= PAGE_WRITE;
    }   
    if (perms & UC_PROT_EXEC) {
        ret |= PAGE_EXEC;
    }   
    return ret;
}

static void raise_mmu_exception(CPUState *cs, target_ulong address,
                                int rw, uintptr_t retaddr);
struct request {
    uint64_t addr;
    bool found;
    struct tlb_entry e;
};

static gboolean lookup_entry(gpointer key, gpointer value, gpointer data)
{
    struct request *req = data;
    uint64_t k = (uint64_t) key;
    struct tlb_entry *v = value;
    if (k > req->addr) {
        req->found = false;
        return true;
    }   

    if (k + v->size > req->addr) {
        req->addr = k;
        req->found = true;
        req->e = *v; 
        return true;
    }
    return false;
}

bool unicorn_fill_tlb(CPUState *cs, vaddr address, int size,
                      MMUAccessType rw, int mmu_idx,
                      bool probe, uintptr_t retaddr)
{
    bool ret = false;
    struct uc_struct *uc = cs->uc;
    struct tlb_entry e;
    struct request req;

    if (uc->tlb) {
        req.addr = address;
        g_tree_foreach(uc->tlb, lookup_entry, &req);
        if (!req.found) {
            goto tlb_miss;
        }
        e = req.e;
        e.paddr += (address & TARGET_PAGE_MASK) - req.addr;
        e.size = TARGET_PAGE_SIZE;
    } else {
        e.paddr = address & TARGET_PAGE_MASK;
        e.size = TARGET_PAGE_SIZE;
    } else {
        e.paddr = address & TARGET_PAGE_MASK;
        e.size = TARGET_PAGE_SIZE;
        e.perms = UC_PROT_READ|UC_PROT_WRITE|UC_PROT_EXEC;
    }
    MemoryRegion *mapping = memory_mapping(uc, e.paddr);

    if (!mapping) {
        goto tlb_miss;
    }

    switch (rw) {
    case MMU_DATA_LOAD:
        ret = mapping->perms & e.perms & UC_PROT_READ;
        break;
    case MMU_DATA_STORE:
        ret = mapping->perms & e.perms & UC_PROT_WRITE;
        break;
    case MMU_INST_FETCH:
        ret = mapping->perms & e.perms & UC_PROT_EXEC;
        break;
    default:
        goto tlb_miss;
    }

    if (!ret) {
        goto tlb_miss;
    }

    tlb_set_page(cs, address & TARGET_PAGE_MASK, e.paddr & TARGET_PAGE_MASK, perms_to_prot(e.perms & mapping->perms), mmu_idx, TARGET_PAGE_SIZE);
    return true;

tlb_miss:
    if (probe) {
        return false;
    }
    raise_mmu_exception(cs, address, rw, ret);
    return false;
}

static void raise_mmu_exception(CPUState *cs, target_ulong address,
                                int rw, uintptr_t retaddr)
{
    cs->uc->invalid_error = 1;
    cpu_exit(cs->uc->cpu);
    cpu_loop_exit_restore(cs, retaddr);
}
```

What do you think about this idea?

I'm currently working on a stable and sane API for this. for testing I have added two function:

```
void unicorn_set_virtual_tlb(struct uc_struct* uc);
uc_err uc_add_tlb_entry(struct uc_struct *uc, uint64_t vaddr, uint32_t size, uint64_t paddr, uint32_t perms);
```

This is only an prototype for testing and the API currently miss some features. First of all I think the best would be to enable this by default and add a way to get the tlb implementation of the emulated CPU. This way the vaddr == paddr assumption from unicorn would be enabled by default, but can be disabled, when required.

